import logo from './logo.svg';
import './App.css';
import {useState} from "react";
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
//import * as parkData from "./capitalCities.json";
import Ciudades from "./capitalCities.json";
import { useMapEvents } from 'https://cdn.esm.sh/react-leaflet/hooks'


function MyComponent() {
  const map = useMapEvents('click', () => {
    map.setCenter([50.5, 30.5])
  })
  return null
}

function MyMapComponent() {
  return (
    <MapContainer center={[50.5, 30.5]} zoom={13}>
      <MyComponent />
    </MapContainer>
  )
}


function App() {

  const [ puntuacion, cambioPuntuacion] = useState(1500)

  const [ acertados, cambioAcertados] = useState(0)

  const reset= () => {
    cambioPuntuacion(1500)
  }
  const acierto= () => {
    if(Ciudades.capitalCities.length < acertados && puntuacion > 0){
      cambioAcertados(+1)
    }else{

    }
  }


  return (
    <div>
      <header>

        <div className="navbar navbar-dark bg-dark shadow-sm">
          <div className="container">
            <a href="#" className="navbar-brand d-flex align-items-center">
              <strong>Cities Quiz</strong>
            </a>
          </div>
        </div>

      </header>

      <main>

        <section className="py-5 text-center container">
          <div className="row align-items-start">
            <div className="col-md-6 col-lg-3">
              { acertados > 0 ?
              (<span className="badge text-bg-success"><span>{acertados}</span> ciudades acertadas</span>
              ) : ""
              }

              <h5>Selecciona en el mapa la localizaci√≥n de:<span></span></h5>
              <h6>Puntuaci√≥n: <span className="badge rounded-pill text-bg-primary">{puntuacion}</span></h6>

              {puntuacion != 0 && acertados === Ciudades.capitalCities.length ?
                (<div className="alert alert-success" role="alert">
                  <p>¬°Enhorabuena üòÉ!</p>
                  <p>Has conseguido averiguar todas las posiciones de las ciudades!</p>
                  <p>Tu puntaci√≥n es de <b>{puntuacion}</b></p>
                </div>) : ""
              }

              {puntuacion == 0 ?
                (<div className="alert alert-danger" role="alert">
                  <p>¬°Has perdido! üôÅ</p>
                  <p>Puedes volver a intentarlo</p>
                </div>) : ""
              }

              <button type="button" onClick={() => reset()} className="btn btn-secondary btn-sm">Volver a empezar</button>

              <div className="mt-5 list">
                <h5>Listado de ciudades</h5>

                <table className="table">
                  <thead>
                    <tr>
                      <th scope="col">#</th>
                      <th scope="col">Ciudad</th>
                    </tr>
                  </thead>
                  <tbody>

                    {Ciudades.capitalCities.map((ciudad,index) => (
                      <tr key={index}>
                        <th scope="row">{index+1}</th>
                        <td>{ciudad.capitalCity}</td>
                      </tr>
                    ))}

                  </tbody>
                </table>
              </div>
            </div >
            <div className="col"> 

              <MapContainer center={[50.99298388467372, 10.78845445118975]} zoom={4}scrollWheelZoom={false}>
               <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                  />

                {Ciudades.capitalCities.map((ciudad,index) => (
                  <Marker
                    key={index}
                    position={[
                      ciudad.lat,
                      ciudad.long
                    ]}
                    eventHandlers={{
                      click: () => {
                        acierto(9)
                      },
                    }}
                  >

                  </Marker>
                ))}
              </MapContainer>

            </div>
          </div>

        </section>

      </main>
    </div>
  );
}

export default App;
